import { View, StyleSheet } from 'react-native';
import { Animated } from './Animated';
import './customAnimations';

const globalDelay = 0.2;

const baseAnimation = 'zoomIn',
  baseDelay = 500,
  baseDuration = 500,
  baseEasing = 'ease-in-out',
  baseIterationCount = 1,
  baseSrc = require('./../../../assets/images/animation/trio_base.png'),
  baseStyles = 'trio_base';

const screenAnimation = 'fadeIn',
  screenDelay = 2000,
  screenDuration = 100,
  screenEasing = 'ease-in-out',
  screenIterationCount = 1,
  screenSrc = require('./../../../assets/images/animation/trio_screen_session.png'),
  screenStyles = 'trio_screen';

const fingerAnimation = 'fingerUp',
  fingerDelay = 1000,
  fingerDuration = 1200,
  fingerEasing = 'ease-in-out-quart',
  fingerIterationCount = 1,
  fingerSrc = require('../../../assets/images/animation/finger.png'),
  fingerStyles = 'finger';

const styles = StyleSheet.create({
  animationWrapper: {
    position: 'relative',
    overflow: 'hidden',
    height: Dimensions.CARD_IMAGE_SIZE_SMALL,
    width: Dimensions.CARD_IMAGE_SIZE_SMALL,
    //backgroundColor: 'red',
  },
  trio_base: {},
  trio_screen: {},
  finger: {
    top: Dimensions.CARD_IMAGE_SIZE_SMALL,
    left: Dimensions.CARD_IMAGE_SIZE_SMALL * -0.1,
  },
});

export const TrioFingerPush = () => {
  return (
    <View style={styles.animationWrapper}>
      <Animated
        animation={baseAnimation}
        delay={globalDelay + baseDelay}
        duration={baseDuration}
        easing={baseEasing}
        iterationCount={baseIterationCount}
        source={baseSrc}
        styles={baseStyles}
      />
      <Animated
        animation={screenAnimation}
        delay={globalDelay + screenDelay}
        duration={screenDuration}
        easing={screenEasing}
        iterationCount={screenIterationCount}
        source={screenSrc}
        styles={screenStyles}
      />
      <Animated
        animation={fingerAnimation}
        delay={globalDelay + fingerDelay}
        duration={fingerDuration}
        easing={fingerEasing}
        iterationCount={fingerIterationCount}
        source={fingerSrc}
        styles={fingerStyles}
      />
    </View>
  );
};
